import React, {useState, useEffect} from 'react';
import "react-responsive-carousel/lib/styles/carousel.min.css"; 
import { Carousel } from 'react-responsive-carousel';

const axios = require('axios');

export const History = () => {
    const [data,setData]=useState([]);

    const getData = () => {
        const url = 'http://localhost:3001/fires?Counties=';
        const arr = ["Sonoma", "Butte", "Napa"];
        const queries = arr.map(county => axios.get(url+county));
        console.log(queries);
        let temp = [];

        axios.all(queries)
        .then(resArr => {
            temp = resArr.map(resArr => resArr.data);
            setData(temp);
        });
    };

    useEffect(()=>{
        getData();
    },[]);

    console.log(data);
    function numFires(county) {
        let numFires = 0;
        county.forEach(fire => {
            if(fire["ArchiveYear"] >= 2015)
                numFires++;
        });
        return numFires;
    }

    return( 
       <Carousel>
           <div>
                <p class="carousel-text">{numFires}</p>
            </div>
            <div>
                <p class="carousel-text"></p>    
            </div>
            <div>
                <p class="carousel-text"></p>
            </div>
       </Carousel>
    );
}
